import { Component } from 'react'
import './index.css'

const btnList = [
    {
        content: 'Login',
        id: 'login'
    },
    {
        content: 'Create Account',
        id: 'createAccount'
    }
]

class LoginHeader extends Component{
    state = {
        activeBtn: btnList[0].id
    }

    onClickingBtn = event => {
        this.setState({activeBtn: event.target.id})
    }

    render() {
        const {activeBtn} = this.state
        return (
            <div className='login-header'>
                <h1 className='brand'>HealthCare</h1>
                <div className='login-header-btn-container'>
                {
                    btnList.map(eachBtn => <button type="button" id={eachBtn.id} key={eachBtn.id} onClick={this.onClickingBtn} className={`login-header-btn ${activeBtn === eachBtn.id? 'active-login-header-btn': ''}`}>{eachBtn.content}</button>)
                }
                </div>
            </div>
        )
    }
}

export default LoginHeader
